Pacific Ocean Blue/Bambu

Dennis Wilson&amp;#039;s &quot;Pacific Ocean Blue&quot; re-issue has been out of print on CD since 1991 and then only issued for 4 weeks.
&quot;Bambu&quot; was not finished. Legacy/Epic/Caribou records has just issued a two disc set re-mixed and includes the &quot;unfinished&quot; tracks from &quot;Bambu&quot;.

I submit the original CD version of POB and the boot version of Bambu.
